import React from 'react';
import '../../css/tweets/Tweet.css';

class Tweet extends React.Component {

    render() {

        return (
            <div>
                <div className="TweetHeader">
                    <div className="Toggle">
                    </div>
                    <div className="TweetTitle">
                        <h2>Tweet Title</h2>
                    </div>
                </div>

                <div className="TweetContent">
                    <div className="TwitterAccount">
                        <h3>Twitter:</h3>
                        <p>Eschmiel</p>
                    </div>
                    <div className="TweetTextBox">
                        <p className="TweetTextContent">This is the text of the tweet. Wowza!</p>
                    </div>
                </div>
            </div>

        );
    }
}

export default Tweet;
